(1, -1, -1, -1, 1, 0, '', '', '', '', '', '', '', '\n\n\n\n\n<title>###TITLE###</title>\n\n@media only screen and (max-width: 620px) {\ntable[class=body] h1 {\nfont-size: 28px !important;\nmargin-bottom: 10px !important; }\ntable[class=body] p,\ntable[class=body] ul,\ntable[class=body] ol,\ntable[class=body] td,\ntable[class=body] span,\ntable[class=body] a {\nfont-size: 16px !important; }\ntable[class=body] .wrapper,\ntable[class=body] .article {\npadding: 10px !important; }\ntable[class=body] .content {\npadding: 0 !important; }\ntable[class=body] .container {\npadding: 0 !important;\nwidth: 100% !important; }\ntable[class=body] .main {\nborder-left-width: 0 !important;\nborder-radius: 0 !important;\nborder-right-width: 0 !important; }\ntable[class=body] .btn table {\nwidth: 100% !important; }\ntable[class=body] .btn a {\nwidth: 100% !important; }\ntable[class=body] .img-responsive {\nheight: auto !important;\nmax-width: 100% !important;\nwidth: auto !important; }}\n@media all {\n.ExternalClass {\nwidth: 100%; }\n.ExternalClass,\n.ExternalClass p,\n.ExternalClass span,\n.ExternalClass font,\n.ExternalClass td,\n.ExternalClass div {\nline-height: 100%; }\n.apple-link a {\ncolor: inherit !important;\nfont-family: inherit !important;\nfont-size: inherit !important;\nfont-weight: inherit !important;\nline-height: inherit !important;\ntext-decoration: none !important; }\n.btn-primary table td:hover {\nbackground-color: #34495e !important; }\n.btn-primary a:hover {\nbackground-color: #34495e !important;\nborder-color: #34495e !important; } }\n\n\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"body\" style=\"border-collapse:separate;background-color:#f6f6f6;width:100%\">\n<tr>\n<td style=\"font-family:sans-serif;font-size:14px;vertical-align:top\"> </td>\n<td class=\"container\" style=\"font-family:sans-serif;font-size:14px;vertical-align:top;max-width:580px;padding:10px;width:580px\">\n<div class=\"content\" style=\"max-width:580px;padding:10px\">\n<table class=\"main\" style=\"border-collapse:separate;background:#fff;width:100%\">\n<!-- START MAIN CONTENT AREA -->\n<tr>\n<td class=\"wrapper\" style=\"font-family:sans-serif;font-size:14px;vertical-align:top;padding:20px\">\n###MSGCONTENT###\n</td>\n</tr>\n<!-- END MAIN CONTENT AREA -->\n</table>\n<!-- START FOOTER -->\n<div class=\"footer\" style=\"clear:both;padding-top:10px;text-align:center;width:100%\">\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"border-collapse:separate;width:100%\">\n<tr>\n<td class=\"content-block\" style=\"font-family:sans-serif;font-size:14px;vertical-align:top;color:#999999;font-size:12px;text-align:center\">\n<span class=\"apple-link\" style=\"color:#999999;font-size:12px;text-align:center\">###FOOTERBIZDEETS###</span>\n<br>\n##UNSUB-LINE##\n</td>\n</tr>\n<tr>\n<td class=\"content-block powered-by\" style=\"font-family:sans-serif;font-size:14px;vertical-align:top;color:#999999;font-size:12px;text-align:center;padding-top:40px;text-align:right\">\n###POWEREDBYDEETS###\n</td>\n</tr>\n</table>\n</div>\n</div>\n</td>\n<td style=\"font-family:sans-serif;font-size:14px;vertical-align:top\"> </td>\n</tr>\n</table>\n\n', 1551887996, 1551887996),
(2, -1, -1, -1, 1, 1, '', '', '', '', '', '', 'Your Client Portal', '<strong>Your Client Portal</strong><br />\n<br />\nWelcome to your Client Portal. Your login details are:<br /><br />\n<ul>\n<li>Login link: ###PORTALLINK###</li>\n<li>Email: ###EMAIL###</li>\n<li>Password: ###PASSWORD###</li>\n</ul><br /><br />\nIn your client portal you can access your quotes and invoices, as well as pay invoices online using PayPal or Stripe. If you have any questions. Let us know.<br />\n<br />\n<strong>###FROMNAME###</strong>', 1551887996, 1551887996),
(3, -1, -1, -1, 1, 2, '', '', '', '', '', '', 'Quote Accepted', '<h3 style=\"text-align:center;font-size: 1.5em;margin-top: 0em;margin-bottom: 2em\">Quote Accepted!</h3>\nHi there,\n<br /><br />\nThis is a notification email to let you know that your proposal <strong>###QUOTETITLE###</strong> has been accepted!\n<br /><br />\nHere is the link to view the proposal online: <a href=\"###QUOTEURL###\">###QUOTEURL###</a>\n<br /><br />\nAnd here is the link to edit the proposal:  <a href=\"###QUOTEEDITURL###\">###QUOTEEDITURL###</a>\n<br /><br />\nAwesome work!\n<br /><br />\n###FROMNAME###', 1551887996, 1551887996),
(4, -1, -1, -1, 1, 3, '', '', '', '', '', '', 'You have received an Invoice', '<div class=\"container\" style=\"max-width:1200px;margin-left:auto;margin-right:auto\">\n  <div id=\"zbs_top_wrapper\">\n      <div id=\"zbs_invoice_logos\" style=\"width:50%;float:left\">\n          <div class=\"wh-logo-set ###LOGOCLASS###\">\n              <img id=\"wh-logo-set-img\" src=\"###LOGOURL###\" style=\"max-width:50%\" />\n          </div>\n      </div>\n      <div class=\"zbs-invoice-topper\" style=\"width: 50%;float: right;text-align: right\">\n          <table class=\"form-table\" style=\"text-align: right;float: right\">\n          <tr class=\"wh-large zbs-invoice-number\">\n            <td><strong><label for=\"no\">Invoice Number:</label></strong></td> \n            <td>###INVNOSTR###</td>\n          </tr>\n          <tr class=\"wh-large\">\n              <td><strong><label for=\"date\">Invoice Date:</label></strong></td>\n              <td>###INVDATESTR###</td>\n          </tr>\n          <tr class=\"wh-large\">\n              <td><strong><label for=\"Reference\">Reference:</label></strong></td>\n              <td>###REF###</td>\n          </tr>\n          <tr class=\"wh-large\">\n              <td><strong><label for=\"due\">Due date:</label></strong></td>\n              <td>###DUEDATE###</td>\n          </tr>\n       </table>\n      </div>\n  </div>\n  <div class=\"clear\" style=\"clear:both\"></div>\n  <div id=\"zbs-business-info-wrapper\">\n      <div class=\"business-info ###BIZCLASS###\">\n          ###BIZINFOTABLE###\n      </div>\n  </div>\n  <div class=\"clear\"></div>\n  <div id=\"zbs-invoice-items\" style=\"margin-top:2em\">\n      <table class=\"table\" style=\"width:100%\">\n          <thead style=\"border:1px solid #ccc;background:#f5f5f5;padding: 20px;line-height: 30px;font-weight: 100\">\n              ###TABLEHEADERS###\n          </thead>\n          <div class=\"zbs-table-block\">\n              ###LINEITEMS###\n          </div>\n      </table>\n  </div>\n  ###TOTALSTABLE###\n  </div>\n  ###VIEWINPORTAL###', 1551887996, 1551887996),
(5, -1, -1, -1, 1, 4, '', '', '', '', '', '', 'You have received a new Proposal', 'Hi there,\n<br /><br />\nThis is a notification email to let you know that your proposal <strong>###QUOTETITLE###</strong> is ready to view &amp; accept online.\n<br /><br />\nHere is the link to view the proposal: <a href=\"###QUOTEURL###\">###QUOTEURL###</a>\n<br /><br />\nPlease do let me know when you are ready to proceed, or if I can help you with anything else.\n<br /><br />\n###FROMNAME###', 1551887996, 1551887996),
(6, -1, -1, -1, 1, 5, '', '', '', '', '', '', 'Your Event starts soon', '<h3 style=\"text-align:center;font-size: 1.5em;margin-top: 0em;margin-bottom: 2em\">Your Event is starting soon</h3>\n<div style=\"text-align:center;font-size: 1.5em;margin-top: 0em;margin-bottom: 2em\">(###EVENTTITLE###)</div>\n<br />\nYou can view your event at the following URL: \n###EVENTLINKBUTTON###', 1551887996, 1551887996),
(10, -1, -1, -1, 1, 6, '', '', '', '', '', '', 'Your Client Portal Password', '<strong>Your Client Portal Password has been reset</strong><br />\n<br />\nYou can now access the client portal with the following information:<br />\n<ul>\n<li>Login link: ###PORTALLINK###</li>\n<li>Email: ###EMAIL###</li>\n<li>Password: ###PASSWORD###</li>\n</ul><br />\n<br />\n<strong>###FROMNAME###</strong>', 1551887998, 1551887998),
(11, -1, -1, -1, 1, 7, '', '', '', '', '', '', 'Your Statement', '<strong>Your Statement for ###BIZNAME###</strong><br />\n<br />\nWe\'ve generated a statement for any invoices you have with ###BIZNAME### (attached to this email as a pdf).<br /><br />\nPlease do check this statement and pay any outstanding balances due.<br /><br /><br />\nYours Sincerely<br /><br />\n<strong>###FROMNAME###</strong>', 1551887998, 1551887998);
